import React from 'react';

const User = () => {
    state = {
        users:[
            {
                name: 'A',
                age: '10'
            },
            {
                name: 'B',
                age: '10'
            }
        ]
    }
    return (
        <div>{this.state.users[0].name} | {this.state.users[0].age}</div>
    )
}
export default User;
